    [],nt"revision_timestamp": "2015-06-17T01:57:22.544346",nt"name": "report-of-sheenjek-valley-field-trip",nt"isopen":
    false,nt"url": null,nt"notes": "The recreational values of the newly established
    Arctic National Wildlife Range are of paramount importance. The exact form these
    values will take is, as yet, unknown. Certainly, different recreational potential
    exists in the different areas of this vast Range. The purpose of this study is to
    determine the recreational potential of the upper Sheenjek River Valley. From July
    25 to August 3 a general survey was made of approximately 10,000 acres in the Lobo
    lake area. The party with their camping gear flew in via a Wien charter flight from
    Fort Yukon.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
